import React from 'react';
import './Logo.css';

const Logo = () => {
  return (
    <div className="logo-container">
      <div className="logo-content">
        <div className="main-logo">G</div>
        <div className="subtitle">TECHNIC</div>
        <div className="decorative-line"></div>
        <div className="tagline">INDUSTRIAL SOLUTIONS</div>
      </div>
    </div>
  );
};

export default Logo;
